import App from './App';

import { Route, Routes, useParams} from "react-router-dom"



function Main() {
    // console.log(useParams())

    return (
        <Routes>
        <Route path="/:num/:id" element={<App chatgpt={true} popup={true}/>} />
        <Route path="/2/:id" element={<App usePopups={false} UseChatGPTDisclaimer={true} />} />  
        <Route path="/3/:id" element={<App usePopups={true} UseChatGPTDisclaimer={false} />} />
        <Route path="/:num/:id" element={<App />} />
      </Routes>
      );
  }

  export default Main;
